import { MenuList } from '@material-ui/core';
import React,{useState} from 'react'
import img from "../SourceFiles/Header/male.png";

function Mentors() {
    const [MentorList, setMentorList] = useState([
        {
            name : 'Mentor 1',
            lastname : 'soyad',
            department : 'sobe',
            skil : 'bacariqlar',
            about : 'haqqinda'
        },
        {
            name : 'Mentor 2',
            lastname : 'soyad',
            department : 'sobe',
            skil : 'bacariqlar',
            about : 'haqqinda'
        },
        {
            name : 'Mentor 3',
            lastname : 'soyad',
            department : 'sobe',
            skil : 'bacariqlar',
            about : 'haqqinda'
        }

    ])
    return (
        <div id = 'mentors'>
            <div id = 'mentors-block' className = 'container'>
                <div id = 'mentors-flex' className = 'flex'>
                <div id = 'mentor-list'>
                    <ul>
                        {MentorList.map(item => {
                            return(
                                <li className = 'mentor-list-item flex'>
                                <img  src = {img}/>
                                <h5>{item.name}</h5>
                            </li>
                            )
                        })}
                    </ul>
                </div>
                <div id = 'mentor-data'>
                    <div id = 'mentor-data-header'>
                        <div id = 'mentor-data-header-flex' className = 'flex'>

                        </div>
                    </div>
                </div>
                </div>
            </div>
        </div>
    )
}

export default Mentors
